webpackJsonp([0x8c5200c2072f],{3014:function(n,e){n.exports={pathContext:{docHtml:'<h1>p-limit <a href="https://travis-ci.org/sindresorhus/p-limit"><img src="https://travis-ci.org/sindresorhus/p-limit.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Run multiple promise-returning &#x26; async functions with limited concurrency</p>\n</blockquote>\n<h2>Install</h2>\n<pre><code>$ npm install --save p-limit\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">const pLimit = require(\'p-limit\');\n\nconst limit = pLimit(1);\n\nconst input = [\n    limit(() => fetchSomething(\'foo\')),\n    limit(() => fetchSomething(\'bar\')),\n    limit(() => doSomething())\n];\n\n// only one promise is run at once\nPromise.all(input).then(result => {\n    console.log(result);\n});\n</code></pre>\n<h2>API</h2>\n<h3>pLimit(concurrency)</h3>\n<p>Returns a <code>limit</code> function.</p>\n<h4>concurrency</h4>\n<p>Type: <code>number</code><br>\nMinimum: <code>1</code></p>\n<p>Concurrency limit.</p>\n<h3>limit(fn)</h3>\n<p>Returns the promise returned by calling <code>fn</code>.</p>\n<h4>fn</h4>\n<p>Type: <code>Function</code></p>\n<p>Promise-returning/async function.</p>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/sindresorhus/p-queue">p-queue</a> - Promise queue with concurrency control</li>\n<li><a href="https://github.com/sindresorhus/p-throttle">p-throttle</a> - Throttle promise-returning &#x26; async functions</li>\n<li><a href="https://github.com/sindresorhus/p-debounce">p-debounce</a> - Debounce promise-returning &#x26; async functions</li>\n<li><a href="https://github.com/sindresorhus/p-all">p-all</a> - Run promise-returning &#x26; async functions concurrently with optional limited concurrency</li>\n<li><a href="https://github.com/sindresorhus/promise-fun">More…</a></li>\n</ul>\n<h2>License</h2>\n<p>MIT © <a href="https://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/p-limit/readme",proj:"argo-ci"}}}});
